INSERT INTO `frontend` (`frontend_id`, `type`, `description`) VALUES
(1, 'home_title', 'AULA VIRTUAL NAZARETH'),
(2, 'home_subtitle', 'Es una plataforma integral que combina tecnologa de vanguardia con pedagoga moderna. Diseada para apoyar la enseanza y el aprendizaje en un entorno digital, esta plataforma ofrece a estudiantes y profesores un espacio interactivo donde pueden conectarse, colaborar y acceder a recursos educativos de manera eficiente'),
(3, 'home_text_button_1', ''),
(4, 'home_redirect_button_1', ''),
(5, 'home_text_button_2', ''),
(6, 'home_redirect_button_2', ''),
(7, 'home_image', '63d837e65c47b2ef11289eed344bf130LOGOAULAVIRTUAL_Mesadetrabajo1.png'),
(8, 'why_us_title', 'MANTENTE INFORMADO SOBRE TU AVANCE ACADEMICO'),
(9, 'why_us_subtitle', 'CONOCE TODOS NUESTROS BENEFICIOS NAZARETH'),
(10, 'why_us_card_1_title', 'ACCESO EN LINEA'),
(11, 'why_us_card_1_description', 'Los estudiantes pueden acceder a sus cursos en lnea desde cualquier lugar y en cualquier momento, lo que brinda flexibilidad a sus horarios.'),
(12, 'why_us_card_2_title', 'CONTENIDO MULTIMEDIA'),
(13, 'why_us_card_2_description', 'El Aula Virtual permite la incorporacin de recursos multimedia, como videos, presentaciones y materiales interactivos, para enriquecer la experiencia de aprendizaje.'),
(14, 'why_us_card_3_title', 'COMUNICACION FACILITADA'),
(15, 'why_us_card_3_description', 'Los estudiantes pueden interactuar con profesores y compaeros a travs de foros de discusin, chat y videoconferencias, fomentando la colaboracin y la participacin activa.'),
(16, 'why_us_bottom_title', 'TODAS LAS HERRAMIENTAS EN UNA SOLA PLATAFORMA'),
(17, 'why_us_bottom_subtitle', 'Los estudiantes y profesores pueden acceder a NAZARETHNET en cualquier momento y desde cualquier lugar, lo que facilita la colaboracin y el aprendizaje en lnea.'),
(18, 'principal_intro', 'IMPACTO EN LA EDUCACIN TCNICA'),
(19, 'principal_title', 'La Plataforma Aula Virtual NAZARETH '),
(20, 'principal_description', 'El Aula Virtual de NAZARETH  ha transformado la educacin tcnica en Per al brindar un acceso ms amplio a la enseanza de calidad y al fomentar la adquisicin de habilidades prcticas. Esta plataforma ha demostrado ser especialmente valiosa durante los desafos globales, permitiendo la continuidad de la educacin en situaciones adversas.'),
(21, 'principal_text_button', ''),
(22, 'principal_redirect_button', ''),
(23, 'principal_image', 'f75b000a5d0c2c8527ff20a37557d3aastudents.png'),
(24, 'second_intro', 'Beneficios clave de Aula Virtual NAZARETH'),
(25, 'second_title', 'Experiencia del usuario Nazareth Lover'),
(26, 'second_description', 'Acceso 24/7: Los estudiantes y profesores pueden acceder a Blackboard en cualquier momento y desde cualquier lugar, lo que facilita la colaboracin y el aprendizaje en lnea.\r\n\r\nGestin de cursos: La plataforma permite a los docentes crear, gestionar y personalizar sus cursos de manera efectiva.\r\n\r\nRecursos en lnea: Los profesores pueden cargar materiales, tareas y recursos de aprendizaje en un solo lugar, simplificando la distribucin de contenidos.\r\n\r\nInteraccin: Blackboard ofrece herramientas de comunicacin y colaboracin, como foros, chat en vivo y videoconferencias, que fomentan la interaccin entre estudiantes y profesores.\r\n\r\nEvaluacin: La plataforma facilita la creacin y calificacin de exmenes y tareas, lo que simplifica el proceso de evaluacin'),
(27, 'second_text_button', ''),
(28, 'second_redirect_button', ''),
(29, 'second_image', '4a204d903e48828c21ae2e8c7abf3227last.png'),
(30, 'about_title', 'NAZARETH ESCUELA SUPERIOR'),
(31, 'about_subtitle', 'AVALADO POR MINEDU'),
(32, 'about_text_button', ''),
(33, 'about_redirect_button', ''),
(34, 'about_image', '94a7cdb8fd2c0ab7cce615336b73a9c4last.png'),
(35, 'widget_title', 'NAZARETH ESCUELA SUPERIOR'),
(36, 'widget_subtitle', 'Todos nacemos con un talento individual que merece ser desarrollado. En NAZARETH  queremos ayudarte a lograr el mximo potencial ofrecindote lo mejor en educacin.  Para ello, apostamos por la innovacin y la exigencia, con una formacin internacional abierta al mundo, sin fronteras.  Es por eso que contamos con un modelo educativo nico que potencia al mximo tu aprendizaje y te lleva al xito a trves del desarrollo y el fortalecimiento de tu talento natural, en la carrera profesional que ms te apasiona.  MARCA LA DIFERENCIA EN NAZARETH..'),
(37, 'about_mission', 'NUESTRA VISIN'),
(38, 'about_mission_description', 'Ser lder en la educacin tcnica por su excelencia acadmica y su capacidad\r\nde innovacin.'),
(39, 'about_vission', 'NUESTRA MISIN'),
(40, 'about_vission_description', 'Formar lideres integros e innovadores con visin empresarial para que\r\ntransformen el Per.'),
(41, 'about_bottom_title', 'TODAS LAS HERRAMIENTAS EN UNA MISMA PLATAFORMA'),
(42, 'about_bottom_subtitle', 'CONECTATE - CHAT - APRENDE'),
(43, 'about_intro_text', 'Experiencia del usuario en '),
(44, 'about_title_1', 'NAZARETH NET'),
(45, 'about_description_1', 'Es as como los estudiantes y docentes NAZARETH , pueden acceder a una plataforma de calidad para las clases virtuales, donde pueden planificar, organizar y realizar las actividades programadas para las prximas sesiones de clases, o visualizar las grabaciones de las videoconferencias. El Aula Virtual de NAZARETH, ofrece actividades ms interactivas y empticas de comunicacin para la comunidad NAZARECINA'),
(46, 'about_text_button', ''),
(47, 'about_redirect_button', ''),
(48, 'about_image_widget', '0a8faf6ff78a17c9d8dd144e2baeea62students.png'),
(49, 'footer_logo', 'e8c9c7ea7e86786b6bd19e7a4fb9194elogonazarethinstitute.png'),
(50, 'footer_text', 'Impulsamos tu Talento'),
(51, 'site_key', '6Lft9L8pAAAAAFXfdN5WLYzWPV0u_Ko8oDg5riOk'),
